/*!

=========================================================
* Material Kit React - v1.7.0
=========================================================

* Product Page: https://www.creative-tim.com/product/material-kit-react
* Copyright 2019 Creative Tim (https://www.creative-tim.com)
* Licensed under MIT (https://github.com/creativetimofficial/material-kit-react/blob/master/LICENSE.md)

* Coded by Creative Tim

=========================================================

* The above copyright notice and this permission notice shall be included in all copies or substantial portions of the Software.

*/
import React from "react";
// nodejs library to set properties for components
import PropTypes from "prop-types";
// nodejs library that concatenates classes
import classNames from "classnames";
// react components for routing our app without refresh
import { Link } from "react-router-dom";
// @material-ui/core components
import withStyles from "@material-ui/core/styles/withStyles";
// @material-ui/icons
// core components
import Header from "components/Header/Header.jsx";
import Footer from "components/Footer/Footer.jsx";
import GridContainer from "components/Grid/GridContainer.jsx";
import GridItem from "components/Grid/GridItem.jsx";
import Parallax from "components/Parallax/Parallax.jsx";
// sections for this page
import HeaderLinks from "components/Header/HeaderLinks.jsx";
import SectionExamples from "./Sections/SectionExamples.jsx";

import componentsStyle from "assets/jss/material-kit-react/views/components.jsx";

class Components extends React.Component {
  render() {
    const { classes, ...rest } = this.props;
    return (
      <div>
        <Header
          brand="Welcome."
          rightLinks={<HeaderLinks />}
          fixed
          color="transparent"
          changeColorOnScroll={{
            height: 400,
            color: "white"
          }}
          {...rest}
        />
        <Parallax image={require("assets/img/nd-bg8.gif")}>
          <div className={classes.container}>
            <GridContainer>
              <GridItem>
                <div className={classes.brand}>
                  <h1 className={classes.title}>NEWDATA</h1>
                  <p>This website was built on the <a href="https://nodejs.org/en/about/" target="blank">NodeJS</a> framework featuring asynchronous prgrommaning, multiipe components and utilized React Libraries.

                </p>
                </div>
              </GridItem>
            </GridContainer>
          </div>
        </Parallax>


        <div className={classNames(classes.main, classes.mainRaised)}>
          <div className={classes.container}>


          <div className={classes.container}>
            <GridContainer>
              <GridItem xs={12} sm={12} md={6}>
              <h1 className={classes.subtitle}>Front-End Web Development</h1>
              <p>Web Developer committed to the user journey, user flow, design &nbsp; development of user portals and integrations. Willing to lead by example and participate in all coding and debugging. Continually considering strengths and improving limitations of product. Experienced with road mapping/project planning efforts and having ownership for delivery. I am actively engaged in project management efforts as the team executes plans. Previous responsibilities include communicating progress and status to stakeholders.</p>
              </GridItem>

              <GridItem xs={12}>
              <h2 className={classes.subtitle}>Primary Technologies</h2>

              <h1 className={classes.subtitle}>Cascading Style Sheets (CSS)</h1>
              <p>I am strong in my understandimng and application of CSS. I am commited to presenting web pages at 100% of what a low resolution wireframe might have been envisioned.  </p>

              <br/>
              <h1 className={classes.subtitle}>Hyper Text Markup Language (HTML)</h1>

              <br/>
              <h1 className={classes.subtitle}>JavaScript</h1>

              <br/>

              <br/>
              <h1>JavaScript</h1>
              </GridItem>

              <GridItem sm={12}>
                <p>User Experience Designer committed to the user journey, user flow, design nbsp; development of user portals and integrations. Willing to lead by example and participate in all coding and debugging. Continually considering strengths and improving limitations of product. Experienced with road mapping/project planning efforts and having ownership for delivery. I am actively engaged in project management efforts as the team executes plans. Previous responsibilities include communicating progress and status to stakeholders.
                </p>
                <br/>
              </GridItem>

            </GridContainer>
            </div>




          </div>
        </div>




        <Footer />
      </div>
    );
  }
}

Components.propTypes = {
  classes: PropTypes.object
};

export default withStyles(componentsStyle)(Components);
